@pkpp1233 @kokozaurz @PatrickGuo 

Ok, the problem is that a recent global renaming for Tensorflow to Tensor**F**low caught the native identifier in [tensorflow_jni.h](https://github.com/tensorflow/tensorflow/blob/aedd2173deef51661ab0cabcb9009d249e744e31/tensorflow/examples/android/jni/tensorflow_jni.h#L31)  but did not correspondingly rename [TensorflowClassifier.java](https://github.com/tensorflow/tensorflow/blob/060484b39d0813a5e209f90d9de81413da310cac/tensorflow/examples/android/src/org/tensorflow/demo/TensorflowClassifier.java).

Either s/TensorFlow/Tensorflow/ in tensorflow_jni.h, or rename and change the class of TensorflowClassifier.java to TensorFlowClassifier. I'll submit a fix to do the latter soon.
